const Social = styled.div`
  display: flex;
  // position: fixed;
  // top: 48%;
  // left: 1.5rem;
  // transform: translateY(-50%);

  ul {
    display: flex;
  }

  .item{
    padding-bottom: 15px;
    padding-top: 15px;
  }
  .item + .item {
    // margin-top: 1rem;
    padding-left: 15px;
  }

  a {
    font-size: 2rem;
    color: rgb(119, 119, 121);
    transition: 0.2s ease-in;
    &:hover {
      color: rgb(57, 134, 250);
    }
  }

  @media screen and (max-width: 768px) {
    display: none;
  }
`;
function FixSocialIcon() {
  return (
    <Social>
      <ul>
        <li className="item">
          <a
            href="https://www.linkedin.com/in/poojith18/"
            target="_blank"
            rel="noopener noreferrer"
          >
            <FaLinkedin />
          </a>
        </li>
        <li className="item">
          <a
            href="https://github.com/poojith18/"
            target="_blank"
            rel="noopener noreferrer"
          >
            <FaGithub />
          </a>
        </li>
        <li className="item">
          <a
            href="https://twitter.com/poojith_18"
            target="_blank"
            rel="noopener noreferrer"
          >
            <FaTwitter/>
          </a>
        </li>
      </ul>
    </Social>
  );
}

export default FixSocialIcon;
